import React from "react";
import ReactDom from 'react-dom'

export default function Modal ({open, children, onClose}) {
    if(!open) return null
    return (
        <>
            <div className="overlayBackground">
            <div className="overlay">
            <button onClick={onClose}> Close Modal </button>
                {children}
            </div>
            </div>
        </>
        )
}
